	_self = (struct ID *)_ptr->data;
	_data = (char *)_parms->data;
	name = *((const char * *)_data);
	_data += 8;
	type = *((int *)_data);
	_data += 8;
	domain = *((int *)_data);
	_data += 8;
	_retdata = _data;
	
	attribute = rna_AttributeGroup_new(_self, reports, name, type, domain);
	*((struct PointerRNA *)_retdata) = attribute;
